import base64
from io import BytesIO
import requests
from PIL import Image
data = """"""

res = requests.post('http://localhost:7777/augmentation', json={'image_base64': data, 'type': 'OBJ_DETECT'})

print(res.status_code)
result = res.json()
print(result['type'])
if result['type'] == 'base64':
    data = result['content']
    img = Image.open(BytesIO(base64.b64decode(data)))
    img.save('./processed.png', 'PNG')
    print('./processed.png')